    const handleClose = () => {
        setOpen(false);
    };

    return (
        <Drawer
            open={open}
            onClose={handleClose}
            PaperProps={{ sx: drawerStyle }} // Corrected to use drawerStyle
            style={{zIndex: 1500}}
        >
            <Box>
                <ArrowBackIcon onClick={() => setOpen(false)}/>
                <Typography>Profile</Typography>
            </Box>

            <Box>

            </Box>

            {/* Add your drawer content here */}
        </Drawer>
    );
};

export default InfoDrawer;
